const RPClient = require('../lib/report-portal-client.js');

const rpClient = new RPClient({
    token: '00000000-0000-0000-0000-000000000000',
    endpoint: 'http://your-instance.com:8080/api/v1',
    launch: 'LAUNCH_NAME',
    project: 'PROJECT_NAME',
    debug: true,
});

// eslint-disable-next-line max-len
const fileData = '';
function makeid() {
    let text = '';
    const possible = ' ABCDEFGHIJKLMNOPQRSTUVWXYZ abcdefghijklmnopqrstuvwxyz 0123456789';

    for (let i = 0; i < 20; i += 1) { text += possible.charAt(Math.floor(Math.random() * possible.length)); }

    return text;
}


const launchObj = rpClient.startLaunch({
    name: 'Client test',
    start_time: rpClient.helpers.now(),
    description: 'DESCRIPTION',
    tags: ['your', 'tags'],
});
const updateLaunch = rpClient.updateLaunch(launchObj.tempId, {
    description: 'test description',
    tags: ['test', 'tag'],
});
const suiteIds = [];
const stepIds = [];
for (let i = 0; i < 10; i += 1) {
    const suiteObj = rpClient.startTestItem({
        description: makeid(),
        name: makeid(),
        start_time: rpClient.helpers.now(),
        type: 'SUITE',
    }, launchObj.tempId);
    suiteIds.push(suiteObj.tempId);
    for (let j = 0; j < 5; j += 1) {
        const stepObj = rpClient.startTestItem({
            description: makeid(),
            name: makeid(),
            start_time: rpClient.helpers.now(),
            type: 'STEP',
        }, launchObj.tempId, suiteObj.tempId);
        stepIds.push(stepObj.tempId);
        for (let r = 0; r < 2; r += 1) {
            rpClient.sendLog(stepObj.tempId, {
                level: 'INFO',
                message: makeid(),
                time: rpClient.helpers.now(),
            });
            rpClient.sendLogWithFile(stepObj.tempId, {
                level: 'INFO',
                message: makeid(),
                time: rpClient.helpers.now(),
            }, {
                name: makeid(),
                type: 'image/png',
                content: fileData,
            });
        }
    }
}
suiteIds.forEach((id) => {
    rpClient.finishTestItem(id, {
        end_time: rpClient.helpers.now(),
        status: 'passed',
    });
});
stepIds.forEach((id) => {
    rpClient.finishTestItem(id, {
        end_time: rpClient.helpers.now(),
        status: 'failed',
    });
});

rpClient.finishLaunch(launchObj.tempId, {
    end_time: rpClient.helpers.now(),
});

updateLaunch.promise.then(() => {
    process.exit();
}, () => {
    process.exit();
});
